SG-1 vindt in de Tok'ra, een vriendelijke afsplitsing van de goa'uld, en de Asgard, een technologisch zeer geavanceerd ras, bondgenoten voor hun strijd tegen de Goa'uld.


13.Spirits - 23 oktober 1998 - Op een planeet ontdekt SG-1 een indianen stam en een mineraal Trinium. Het mineraal is sterker als staal en SGC wil gaan ontginnen. Maar de geesten van de indianen steken hier een stokje voor.

14.Touchstone - 30 oktober 1998 - Op een planeet wordt het weer geregeld door de Toetssteen (Touchstone). Sg-1 ontdekt een duister zaakje als blijkt dat een ander SG team de Toetssteen heeft gestolen.

15.The Fifth Race - 22 januari 1999 - O'Neill krijgt de kennis van de Ancients in zijn hoofd gedownload en komt in contact met de Asgard

16.A Matter of Time - 29 januari 1999 - Als een planeet wordt opgeslokt door een zwart gat, wordt het effect door de stargate doorgeven naar de aarde en kan de verbinding niet worden uitgeschakeld, evenmin na 38 minuten.
